syntax = "proto3";

package domain;

message TestOrder_Base {
  string objectId = 1;
  string testOrderId = 2;
  string panelOrderId = 3;
  string aliquotOrderId = 4;
  int32 testId = 5;
  string testName = 6;
  string testAbbreviation = 7;
  string result = 8;
  string comment = 9;
  bool orderedAsDual = 10;
  bool noCharge = 11;
}
